script: |
  super -f text -I q10663.spq | sort > q10663.out

inputs:
  - name: q10663.spq
    data: |
      SELECT DISTINCT - 81 + - col0 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL NOT IN ( + col1 * + CAST ( NULL AS REAL ) + - 20 * + col0 + + col1 + - - col0 * + col0 );
  - name: tab2

outputs:
  - name: q10663.out
    data: |
